where to display currency - before ($ 123) or after (123 $) the number\",\"Aceasta setare controleaza unde se afiseaza moneda valutara - Inainte de ($ 123) sau dupa (123 $) numarul\"],[\"If affiliates doesn't specify his minimum payout balance, this value will be used.\",\"Daca afiliatii nu specifica echilibrul minim de plata, aceasta valoare va fi folosita.\"],[\"Affiliates to pay\",\"Afiliatii platilor\"],[\"No data are matching your search\",\"Nu exista date care sa se potriveasca cautarii dumneavoastra \"],[\"Version Update\",\"Traducerea actualizata\"],[\"Language code is unique for every language. Example of American English code is en-US. The list of most language codes can be found at: <a href='http:\\/\\/msdn.microsoft.com\\/en-us\\/library\\/ms533052(VS.85).aspx' terget='_blank'>http:\\/\\/msdn.microsoft.com\\/en-us\\/library\\/ms533052(VS.85).aspx)<\\/a>\",\"Codul limbii este unic pentru fiecare limbaj. Exemplu: la engleza america codul este US. Lista tuturor codurilor limbajelor poate fi gasita la: <a href='http:\\/\\/msdn.microsoft.com\\/en-us\\/library\\/ms533052(VS.85).aspx' terget='_blank'>http:\\/\\/msdn.microsoft.com\\/en-us\\/library\\/ms533052(VS.85).aspx)<\\/a>\"],[\"Yes, Reload Application\",\"Da, incarcati aplicatia\"],[\"Request error\",\"Eroare\"],[\"Your session expired.\",\"Sesiunea dvs. a expirat\"],[\"Invalid server response.\",\"Raspuns invalid al serverului\"],[\"Manual commission\",\"Comision manual\"],[\"Brainstorming\",\"Brainstorming\"],[\"GetStartedBrainstorming\",\"Primul pas este important - gandeste-te la programul de afiliere <br\\/>\\nTrebuie sa ai un plan ca sa atingi scopul. Cat de mari iti permiti sa ai comisioanele ca sa realizezi ce ti-ai propus? <br\\/>\\nVor fi ele destul de atractive afiliatilor comparandu-le cu cele ale competitiei. Cum sa-i atrag pe afliliati ca sa se alature?\"],[\"Review your settings\",\"Revizuirea setarilor\"],[\"GetStartedSettings\",\"Post Afiliere Xpress se face intr-un mod in care se poate lucra cu configuratia implicita <br\\/> Cu toate acestea, ar trebui sa verificati configuratia si sa gasiti aplicatiile pentru nevoile dumneavoastra.. <br\\/> Puteti gasi ecranul de configurare sub < meniul strong> Configurare & Unelte -> Configurare <\\/ strong>. <br\\/> <br\\/> Descrierea detaliata a tuturor optiunilor de configurare poate fi gasita in ghidul utilizatorului de cunostinte\"],[\"Define your commissions\",\"Defineste-ti comisioanele\"],[\"GetStartedCommissions\",\"O campanie implicita este creata in timpul instalarii. Puteti sa o modificati pentru a crea propriile campanii <br\\/> <br\\/>.\\nCampaniile sunt utilizate pentru a grupa un set de produse (sau doar un singur produs), care au acelea\\u0139\\u017ai set\\u00c4\\uf183ri <br\\/> <br\\/>.\\nDe exemplu, pute\\u0139\\u0141i avea campania pentru produsul 1, unde veti recompensa afilia\\u0139\\u0141ii dumneavoastr\\u00c4\\uf183 pe clic \\u0139\\u017ai o alt\\u00c4\\uf183 campanie pentru produsul 2, \\u0102\\u00aen cazul \\u0102\\u00aen care afiliatii primesc comisioane pe v\\u0102\\u02d8nzare <br\\/> <br\\/>.\\nSau pute\\u0139\\u0141i avea campanie cu produse low cost, care va avea 40% pe comisioanele de v\\u0102\\u02d8nzare \\u0139\\u017ai o alt\\u00c4\\uf183 campanie cu produse scumpe cu 15% pe comision de v\\u0102\\u02d8nzare.\"],[\"Add banners and other creatives\",\"Adaugati bannere si alte aplicatii\"],[\"GetStartedCreatives\",\"In <strong>managerul bannerelor<\\/strong> poti avea diverse aplicatii, precum: link-uri text, bannere standard in HTML, bannere flash si pentru e-mail.<br\\/>\\nEvery banner must have destination URL specified - it is the URL where the visitor is redirected after click.\"],[\"Set up emails\",\"Seteaza-ti email-ul\"],[\"GetStartedEmails\",\"Ar trebui sa setezi functionalitatea email-ului. Aceasta include: <ul> <li> <strong> <Contul de posta electronica \\/ strong> - cum sunt email-urile trimise. Puteti opta fie pentru functia mail () sau serverul SMTP. <\\/ li> <li> <strong> Sabloanele email-urilor<\\/strong> - acestea sunt sabloanele care sunt folosite atunci cand sistemul trimite automat email-uri, dupa inscriere sau dupa notificarile de vanzare <\\/ li> <li> <strong>Notificarile de e-mail <\\/strong> - puteti configura ce fel de notificari sa primti ca si comerciant si ce notificari vor fi disponibile pentru afiliati. <\\/ li> <\\/ ul> Asigurati-va ca email-ul este configurat corect - incercati sa trimiteti e-mailuri de testare. Fara email-urile de lucru afiliatii nu vor primi confirmarea despre inscrierea lor. etc\"],[\"Customize your affiliate signup form\",\"Personalizeaza-ti cererea de inscriere\"],[\"GetStartedSignupForm\",\"Verificati formularul de inscriere standard, si personalizati-l daca doriti <br\\/> <br\\/>.\\nFormularul de inscriere va veni cu un mini-site de informare care contine informatii despre programul de afiliere, etc <br\\/> Puteti utiliza mini-site, sau stergeti-l si folositi numai formularul de Inscriere\"],[\"Customize affiliate panel\",\"Personalizati panoul de afiliere\"],[\"GetStartedAffPanel\",\"Panoul de afiliere din Post Affiliate Xpress este foarte flexibil. <br\\/> Puteti configura meniul dvs., ce sa contina si chiar sa scrieti continul sau link-ul altor pagini.\"],[\"GetStartedIntegrate\",\"Integrarea este o modalitate de a conecta sistemul de afiliat la site-ul dvs. curent, cosul de cumparaturi sau sistemul de plati gateway-ul intr-un mod in care sistemul de afiliere va notifica recomandarile si achizitiile. <br\\/>\\nAtunci cand este notificat, sistemul de afiliat inregistreza vanzararile, constata trimitere afiliat (daca exista) si creeaza comisioane adecvate pentru ei <br\\/> <br\\/>.\\nIntegrarea inseamna de obicei, adaugarea catorva linii de cod in paginile dvs. si este descrisa pas-cu-pas in ghidul de integrare pentru cele mai comune cumparaturi online si sisteme de plati\"],[\"Test everything\",\"Testeaza tot\"],[\"GetStartedTest\",\"Cand v-ati configurat campaniile dvs., ati definit comisioanele corect si ati creat unele bannere \\/ link-uri, ar trebui sa testati sistemul. <br\\/>\\nCel mai bine este sa simulati intregul proces al afiliat si din punctul dumneavoastra de vedere:\\n<ol>\\n<li> Inscrie-ti unii afiliati de testare - dupa aprobare ar trebui sa primiti e-mail de confirmare cu parola si ar trebui sa va puteti conecta la panoul afiliat <\\/ li>\\n<li> Conectati-va la panoul de afiliere, pentru a primi coduri pentru bannere \\/ link-uri si puneti-le pe unele pagini de testare <\\/ li>\\n<li> Faceti clic pe banner si verificati daca clicul este inregistrat <\\/ li>\\n<li> Dupa clic, incercati sa faceti testul de vanzare si sa verificati daca comisioanele de vanzare au fost inregistrate in sistemul de afiliere (numai pe vanzari sau pe comenziile comisioanelor) <\\/ li>\\n<\\/> Ol\\nDaca va confruntati cu unele probleme, in oricare dintre aceste etape, porniti <strong> jurnalul evenimentelor de depanare <\\/ strong> si uitati-va la <strong> depanare <\\/ strong>\"],[\"Promote your affiliate program\",\"Promoveaza programul de afiliere\"],[\"GetStartedPromote\",\"Dupa ce au testat cu succes integrarea sistemului de afiliere cu site-ul dvs., totul este gata pentru a porni programul de promovare a noului afiliat, astfel incat veti atrage afiliati noi sa vi se alature <br\\/> <br\\/>.\\nEste o necesitate de a pune link-ul la informatiile programului de afiliere sau o inscriere formularul pe site-ul tau. Numeste link-ul ca program de afiliere, webmasteri face bani, Afiliatii etc Acest lucru va atrage vizitatorii catre site-ul dvs. si se pot converti la afiliati dumneavoastra <br\\/> <br\\/>.\\nPentru a atinge mai mult potential, prezentati programul dvs. directoarelor afiliate. Exista zeci de directoare afiliate pe web, vizitate de mii de afiliatii cu experienta in fiecare zi.\"],[\"Ad Channels\",\"Adauga canale\"],[\"Advanced tools\",\"Instrumente avansate\"],[\"Subaffiliate Sale Stats\",\"Statusurile vanzarilor subafiliatilor\"],[\"ContactUs\",