ur affiliate program.<br\\/><br\\/>I wish you all success in promoting our products, and profitable partnership for both you and us.\",\"Buna ziua si bun venit la programul nostru de afiliere.  Sunt managerul dvs. si sunt aici daca aveti intrebari sau orice probleme legate de programul m@dd de afiliere !<br\\/> <br\\/> Va doresc succes in promovarea produselor noastre, precum si un parteneriat profitabil atat pentru tine cat si pentru noi.\"],[\"Are you sure you want to delete selected language(s)?\",\"Sunteti sigur ca doritii sa stergeti limba selectata ?\"],[\"Delete language\",\"Stergeti limba\"],[\"Campaign for commissions can be choosen by Product ID instead of banner. To do this you need to specify all product IDs that belong to this campaign. Product IDs need to be comma separated.\",\"Campaniile pentru comisioane pot fi alese de ID-ul produsului \\u0102\\u00aen loc de banner. Pentru a face aceasta, ave\\u0139\\u0141i nevoie sa specificati toate ID-urile produselor care apar\\u0139\\u0141in acestei campanii. ID-urile produselor trebuie s\\u00c4\\uf183 fie separate de virgula.\"],[\"Create new Mailing List\",\"Creati o noua lista de discutii\"],[\"Mailing list name\",\"Numele listei de discutii\"],[\"Type in unique Mailing list name\",\"Tipul listei de mailing cu nume unice\"],[\"Success signup URL\",\"URL-ul inscris cu succes\"],[\"User will be redirected to this url in case he will confirm his registration in Mailing list. It is used in case Double Optin mechanism is used. If not defined, default message is displayed without redirection.\",\"Utilizatorul va fi redirectionat catre acest URL in cazul in care va confirma inregistrarea in lista de discutii. Este utilizat in dublul Optin mecanism care este utilizat. Daca nu este definit, mesajul implicit este afisat fara redirectionare.\"],[\"Double Opt-In\",\"Double opt-in\"],[\"Subscription to mailing list has to be confirmed by user. This is usually done by responding to a confirmation email sent to the email address in subsription request. This eliminates the chance of abuse where somebody submits somebody else's email address without their knowledge and against their will.\",\"Abonarea la lista de discutii trebuie sa fie confirmata de catre utilizator. Acest lucru se face de obicei, raspunzand la un e-mail de confirmare. Aceasta elimina  posibilitatea de abuz in cazul in care cineva sustine adresa ta de email fara stirea ta si impotriva vointei tale.\"],[\"Newsletters\",\"Newsletters\"],[\"Here you can find list of your Mailing Lists. You can manage listings by editing existing or adding new Newsletter.\",\"Aici puteti gasi lista corespondentei. Aveti posibilitatea sa gestionati lista prin adaugarea de noi stiri.\"],[\"Add new Mailing list\",\"Adauga lista noua de discutii\"],[\"Other\",\"Alte\"],[\"For changes to take effect restart of application is needed. Do you want to restart now?\",\"Pentru ca modificarile sa aiba efect, reporniti aplicatia. Vreti sa o reporniti acum?\"],[\"Undefined\",\"Nedefinit\"],[\"You have no private campaign\",\"Nu aveti nici o campanie privata\"],[\"You can contact us directly using this contact form. Your message will be sent to your affiliate manager by email.\",\"Ne puteti contacta direct folosind formularul de contact. Mesajul dvs. va fi trimis la managerul dvs. prin e-mail.\"],[\"Unique clicks\",\"Clic-uri unice\"],[\"Import selected\",\"Import selectat\"],[\"Please wait, import of selected languages can take few minutes.\",\"Va rugam sa asteptati, importul limbilor selectate poate dura cateva minute.\"],[\"Select your preferred theme for your affiliate panel.\",\"Selectati tema preferata pentru panoul dvs. de afiliat.\"],[\"With performance reward rule you can reward your affiliates for their performace and motivate them to refer more customers to you.\",\"Cu regula recompensei performantei puteti recompensa afiliatii dvs. pentru performanta lor si motiva pentru ati trimite mai multi clienti.\"],[\"Apply for license key\",\"Aplicati pentru un cheia licentei\"],[\"Offline Validation Request\",\"Cerere de validarea offline\"],[\"Simple PDF\",\"Simplu PDF\"],[\"If you want your campaign to have a special logo, specify it here.<br\\/>Logo will be visible to your affiliates.\",\"Daca doriti ca si campania dvs. sa aiba un logo special, specificati aici <br\\/> Logo-ul va fi vizibil pentru toti afiliatii dumneavoastr\\u00c4\\uf183.\"],[\"Lifetime of cookie in days for this campaign. 0 means infinite. It defines for how many from the original referral your affiliate will get commissions.<br\\/>For example, if you specify 14 days, affiliate will get commissions for all sales coming for the 14 days since visitor last click on his link.\",\"Durata de viata a cookie in zile pentru aceasta campanie. 0 inseamna infinit. Acesta defineste pentru cat de multe zile de la sesizare originala afiliatul dvs va primi comisioane. <br\\/> De exemplu, daca\\uf183 specificati 14 zile, afiliatul va primi comisioane pentru toate vanzarile de 14 de zile de la vizitarea ultimului clic pe link-ul sau.\"],[\"Export file header template\",\"Exportati sablonul antetului fisierului\"],[\"Export file row template\",\"Exportati sablonul randului fisierului\"],[\"Export file footer template\",\"Exportati sablonul subsolului fisierului\"],[\"Username (email)\",\"Nume de utilizator (email)\"],[\"You have to select affiliate for this preview\",\"Trebuie sa selectati afiliatul pentru aceasta previzualizare\"],[\"Export filename\",\"Numele fisierului de export\"],[\"This video will help you better understand the Affiliate panel and quickly start promoting.\",\"Acest video va va ajuta sa intelegeti  mai bine panoul de afiliere si sa incepeti rapid promovarea.\"],[\"Merchant panel tutorial video\",\"Video despre panoul comerciantului\"],[\"In this video Chuck Lasker explains and clicks through basic forms of merchant control panel. He will show you how to navigate through main sections of application. In same time you can see in action h